import axios from "axios";
export default {
  name: "userAttractions",
  data: () => {
    return {
      maneges: null,
      stands: null,
      artistes: null
    };
  },
  methods: {
    getData() {
      axios({
        method: 'get',
        url: 'http://localhost:3000/'
      }).then(data => {
        if (data.data.success) {
          this.maneges = data.data.data.maneges;
          this.stands = data.data.data.stands;
          this.artistes = data.data.data.artistes;
        }
      });
    }
  },
  mounted() {
    this.getData();
  }
};
